sys_variable_value.value:
(function execute(inputs, outputs) {
    var feedbackUtils = new FeedbackUtils();
    var feedbackId = inputs.feedbackiD;

    // Get feedback details by sys_id
    var detail = feedbackUtils.getFeedbackById(feedbackId);
    outputs.feedbackdetail = detail ? JSON.stringify(detail) : "";

    // Check and return if feedback is positive as 'true' or 'false'
    var isPositive = feedbackUtils.isFeedbackPositive(feedbackId);
    outputs.isfeedbackpositive = isPositive ? "true" : "false";
})(inputs, outputs);

